INSERT INTO `grounds_for_rejection` (`id`, `namespace`, `bid_status`, `code`, `title`, `description`, `active`) VALUES
(1,	'pre-qualification',	'participant',	'qualification',	'Не відповідає кваліфікаційним критеріям',	'Учасник не відповідає кваліфікаційним (кваліфікаційному) критеріям, установленим в тендерній документації',	1),
(2,	'pre-qualification',	'participant',	'eligible',	'Наявні підстави, зазначені у статті 17',	'Наявні підстави для відхилення тендерної пропозиції, зазначені у статті 17 і частині сьомій статті 28 Закону Про публічні закупівлі',	1),
(3,	'pre-qualification',	'participant',	'documents',	'Не відповідає вимогам тендерної документації',	'Тендерна пропозиція не відповідає вимогам тендерної документації',	1),
(4,	'pre-qualification',	'winner',	'qualification',	'Відмовився від підписання договору',	'Переможець відмовився від підписання договору про закупівлю відповідно до вимог тендерної документації або укладення договору про закупівлю',	1),
(5,	'pre-qualification',	'winner',	'eligible',	'Не надав документи по ст.17',	'Переможець не надав документи, що підтверджують відсутність підстав, передбачених ст 17 Закону, або надані документи не підтверджують відсутність підстав, передбачених ст.17 Закону',	1);
