INSERT INTO `rationale_types` (`id`, `name`, `title`, `description`) VALUES
(1,	'durationExtension',	'Продовження строку дії договору (через документально підтверджені об’єктивні обставини)',	'продовження строку дії договору та виконання зобов’язань щодо передання товару, виконання робіт, надання послуг у разі виникнення документально підтверджених об’єктивних обставин, що спричинили таке продовження, у тому числі непереборної сили, затримки фінансування витрат замовника, за умови, що такі зміни не призведуть до збільшення суми, визначеної в договорі;'),
(2,	'fiscalYearExtension',	'Продовження строку дії договору на наступний рік',	'зміна умов у зв’язку із застосуванням положень частини п\'ятої цієї статті: 5. Дія договору про закупівлю може продовжуватися на строк, достатній для проведення процедури закупівлі на початку наступного року, в обсязі, що не перевищує 20 відсотків суми, визначеної в договорі, укладеному в попередньому році, якщо видатки на цю мету затверджено в установленому порядку.'),
(3,	'itemPriceVariation',	'Зміна ціни за одиницю товару',	'зміна ціни за одиницю товару не більше ніж на 10 відсотків у разі коливання ціни такого товару на ринку, за умови, що зазначена зміна не призведе до збільшення суми, визначеної в договорі;'),
(4,	'priceReduction',	'Узгоджене зменшення ціни',	'узгоджена зміна ціни в бік зменшення (без зміни кількості (обсягу) та якості товарів, робіт і послуг);'),
(5,	'qualityImprovement',	'Покращення якості предмета закупівлі',	'покращення якості предмета закупівлі за умови, що таке покращення не призведе до збільшення суми, визначеної в договорі;'),
(6,	'taxRate',	'Зміна ціни у зв’язку із зміною ставок податків і зборів',	'зміна ціни у зв’язку із зміною ставок податків і зборів пропорційно до змін таких ставок;'),
(7,	'thirdParty',	'Зміна сторонніх показників (курсу, тарифів...)',	'зміна встановленого згідно із законодавством органами державної статистики індексу споживчих цін, зміни курсу іноземної валюти, зміни біржових котирувань або показників Platts, регульованих цін (тарифів) і нормативів, які застосовуються в договорі про закупівлю, у разі встановлення в договорі про закупівлю порядку зміни ціни;'),
(8,	'volumeCuts',	'Зменшення обсягів закупівлі',	'зменшення обсягів закупівлі, зокрема з урахуванням фактичного обсягу видатків замовника;');
INSERT INTO `reject_reasons` (`id`, `title`, `description`, `status`, `procurement_method_type`) VALUES
(1,	'Не відповідає кваліфікаційним критеріям',	'Учасник не відповідає кваліфікаційним (кваліфікаційному) критеріям, установленим в тендерній документації',	'pending',	'open'),
(2,	'Наявні підстави, зазначені у статті 17',	'Наявні підстави для відхилення тендерної пропозиції, зазначені у статті 17 і частині сьомій статті 28 Закону Про публічні закупівлі',	'pending',	'open'),
(3,	'Не відповідає вимогам тендерної документації',	'Тендерна пропозиція не відповідає вимогам тендерної документації',	'pending',	'open'),
(4,	'Відмовився від підписання договору',	'Переможець відмовився від підписання договору про закупівлю відповідно до вимог тендерної документації або укладення договору про закупівлю',	'active',	'open'),
(5,	'Не надав документи по ст.17',	'Переможець не надав документи, що підтверджують відсутність підстав, передбачених ст 17 Закону, або надані документи не підтверджують відсутність підстав, передбачених ст.17 Закону',	'active',	'open'),
(6,	'Не відповідає кваліфікаційним критеріям',	'Учасник не відповідає кваліфікаційним (кваліфікаційному) критеріям, установленим в тендерній документації',	'pending',	'defense'),
(7,	'Наявні підстави, зазначені у статті 17',	'Наявні підстави для відхилення тендерної пропозиції, зазначені у статті 17 і частині сьомій статті 28 Закону Про публічні закупівлі',	'pending',	'defense'),
(8,	'Не відповідає вимогам тендерної документації',	'Тендерна пропозиція не відповідає вимогам тендерної документації',	'pending',	'defense'),
(9,	'Ненадання або несвоєчасне надання учасником одиниці товару на перевірку відповідності зразку-еталону ',	'та/або іншим вимогам замовника до предмета закупівлі, зазначеним в оголошенні про проведення відбору, або документів про підтвердження відповідності товару, роботи чи послуги технічним, якісним та кількісним характеристикам предмета закупівлі, визначеним ',	'pending',	'defense'),
(10,	'Невідповідність товарів, робіт чи послуг учасника технічним, якісним та кількісним характеристикам предмета закупівлі',	'',	'pending',	'defense'),
(11,	'Відсутність підтвердження подання забезпечення цінової пропозиції ',	'',	'pending',	'defense'),
(12,	'Відмова або неучасть учасника відбору в переговорах, призначених замовником',	'у визначену замовником дату їх проведення',	'pending',	'defense'),
(13,	'Відмова учасника відбору від участі в переговорах з ціною/приведеною ціною, поданою ним за результатами проведеного аукціону',	'',	'pending',	'defense'),
(14,	'Неусунення учасником недоліків у поданих ним документах протягом наступних 24 годин з моменту ознайомлення учасника з такими недоліками під час проведення переговорів',	'',	'pending',	'defense'),
(15,	'Учасник протягом одного року до дати проведення електронного аукціону вчинив порушення в одного й того самого замовника',	'не приймав участі або відмовився від участі в переговорній процедурі закупівлі до оприлюднення повідомлення про намір укласти договір - більше трьох разів;\nвідмовився від підписання договору про закупівлю у визначені замовником терміни - більше двох разів',	'pending',	'defense');
